{"operationName":"getAccountCoinActivity","variables":{"address":"0x3e747b4b46e6e766123917ed3c7fca23432b444487b4786348997f843595616c","offset":0,"limit":100},"query":"query getAccountCoinActivity($address: String!, $offset: Int, $limit: Int) {
  coin_activities(
    where: {owner_address: {_eq: $address}}
    limit: $limit
    offset: $offset
    order_by: [{transaction_version: desc}, {event_account_address: desc}, {event_creation_number: desc}, {event_sequence_number: desc}]
  ) {
    ...CoinActivityFields
    __typename
  }
}

